import './App.css';
import { useEffect } from 'react';

function App() {

  useEffect(() => {
    fetch('http:localhost:8080/api/todoItems').then((response) => 
      response.json()
    ).then(todoItems => {
      console.log(todoItems);
    });
  });

  return <div> Hi! this is my app </div>
}
export default App;
